import os

import cv2


def sift_create(type):
    """
    :param type: str "sift"/"surf"/"orb" 三选一
    :return:
    """
    # opencv里sift的专利过期了，装个补丁才能用：pip install opencv-contrib-python
    if type == 'sift':
        sifter = cv2.xfeatures2d.SIFT_create()
    elif type == 'surf':
        sifter = cv2.xfeatures2d.SURF_create()
    elif type == 'orb':
        sifter = cv2.ORB_create()

    # 创建FLANN匹配对象
    FLANN_INDEX_KDTREE = 0
    indexParams = dict(algorithm=FLANN_INDEX_KDTREE, trees=5)
    searchParams = dict(checks=50)
    flann = cv2.FlannBasedMatcher(indexParams, searchParams)

    return sifter, flann


def getMatchNum(matches, ratio):
    """返回特征点匹配数量和匹配掩码"""
    matchesMask = [[0, 0] for i in range(len(matches))]
    matchNum = 0
    select = []
    for i, (m, n) in enumerate(matches):
        if m.distance < ratio * n.distance:  # 将距离比率小于ratio的匹配点删选出来
            matchesMask[i] = [1, 0]
            matchNum += 1
            select.append([m])
    return matchNum, matchesMask, select


def sift_diff(flann, des1, des2, ratio):
    """
    :param ratio: 可调参数，值越大，匹配的线条越密集，但错误匹配点也会增多，
                  在lowe论文中作者推荐ratio的阈值为0.8
    """
    matches = flann.knnMatch(des1, des2, k=2)  # 匹配特征点，为了删选匹配点，指定k为2，这样对样本图的每个特征点，返回两个匹配
    matchNum, matchesMask, select = getMatchNum(matches, ratio)  # 通过比率条件，计算出匹配程度
    matchRatio = matchNum / len(matches)
    return select, matchRatio


def get_sim_sift(img1, img2, type, ratio):
    """
    :param img1: cv2.imread()读取的图片1
    :param img2: cv2.imread()读取的图片2
    :param type: str "sift"/"surf"/"orb" 三选一
    :param ratio: 可调参数，值越大，匹配的线条越密集，但错误匹配点也会增多，在lowe论文中作者推荐ratio的阈值为0.8
    :return: float 范围[0,1]的两张图的相似度
    """
    sift, flann = sift_create(type)
    kp1, des1 = sift.detectAndCompute(img1, None)
    kp2, des2 = sift.detectAndCompute(img2, None)

    img1 = cv2.drawKeypoints(img1, kp1, img1, color=(255, 0, 255))  # 绘制关键点
    img2 = cv2.drawKeypoints(img2, kp2, img2, color=(255, 0, 255))  # 绘制关键点

    # cv2.imshow('keypoint1', img1)
    # cv2.waitKey(0)
    # cv2.imshow('keypoint2', img2)
    # cv2.waitKey(0)

    matches, similarity = sift_diff(flann, des1, des2, ratio)

    img_match = cv2.drawMatchesKnn(img1, kp1, img2, kp2, matches, None, flags=2)
    cv2.imshow("keypoint_match", img_match)
    cv2.waitKey(0)
    cv2.imwrite("sift_result.png", img_match)

    return similarity


